import React, { useState } from 'react';
import '../mycss/Contact.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';
import Footer from './Footer';
import Navbar from './Navbar';
import axios from 'axios';

function Contact() {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    message: ''
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async () => {    
    try {
        const response = await axios.post('http://localhost:5000/submit-form', formData);
        console.log(response.data);
        if (response.data.success) {
            // Form submission successful, do something (e.g., show success message)
            alert("Success");
        } else {
            // Form submission failed, extract and display errors
            const { errors } = response.data;
            // Example: Display errors for each field
            console.log('Errors:', errors);
        }
    } catch (error) {
        console.error('Error submitting form:', error);
        console.log('Error response:', error.response);
    }
  };


  const onSubmit = (e) => {
    e.preventDefault();
    handleSubmit();
  };

  return (
    <div>
        <Navbar />
        <div className="contact-container">
            <h2><FontAwesomeIcon icon={faEnvelope} /> Contact Me</h2>
            <form onSubmit={onSubmit}>
                <div className="form-group">
                    <label>Name:</label>
                    <input type="text" name="name" value={formData.name} onChange={handleChange} />
                </div>

                <div className="form-group">
                    <label>Email:</label>
                    <input type="email" name="email" value={formData.email} onChange={handleChange} />
                </div>

                <div className="form-group">
                    <label>Message:</label>
                    <textarea name="message" value={formData.message} onChange={handleChange} />
                </div>
                <button type="submit">Send Message</button>
            </form>
        </div>
        <Footer />
    </div>
  );
}

export default Contact;
